from typing import List


class Solution:
    def countSquares2(self, matrix: List[List[int]]) -> int:
        def check(size, a, b):
            for i in range(size):
                for j in range(size):
                    if not matrix[a + i][b + j]:
                        return 0
            return 1

        la = len(matrix)
        lb = len(matrix[0])
        l = min(la, lb)
        cnt = 0
        for size in range(1, l + 1):
            # size_cnt = 0
            for a in range(0, la - size + 1):
                for b in range(0, lb - size + 1):
                    # if a + size <= la and b + size <= lb:
                    r = check(size, a, b)
                    cnt += r
                    # size_cnt += r
            # print(size, size_cnt)
        print(cnt)
        return cnt

    def countSquares(self, matrix: List[List[int]]) -> int:
        # check ruin
        la = len(matrix)
        lb = len(matrix[0])
        l = min(la, lb)
        cnt =0
        for size in range(1,l+1):
            cnt += (la-size+1)*(lb-size+1)
        print(cnt)


